[[module CSS]]
@import url(http://scpsandboxcn.wikidot.com/local--files/tnsbilws/TING-Theme.css);

@media (max-width: 479px) {

#search-top-box,#side-bar,#login-status {
display:none
}
}

@media (max-width: 1700px){
.phone {
    font-size: 60%;
}
}

a:visited {
    color: #565656;
}

a {
    color: #404040;
    text-decoration: none;
    /* background: transparent; */
}

#top-bar ul li:hover a:hover {
    background: #000;
    text-decoration: none;
    color:#f4f4f4
}

.gp-right-1{
border:0.5px solid silver;
padding:0.2em 1em;
width:40%;
}

.gp-right-2{
border:0.5px solid silver;
padding:0.2em 1em;
}

.gp-left-txt{
border:0.5px solid silver;
width:10%;
background:#f0f0f0;
text-align:center;
}

.gp-left-note{
padding:0.2em 0.5em;
background:#f0f0f0;
}

.gp-line{
border:0.5px solid silver;
padding:0.2em 1em;
}

