> 回复@[http://库加尔.com 库加尔] [http://Ins.com Insbilws]：我也是，作为队长还是的注意一下一些会找我们麻烦的家伙。

> [[image https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1545800610058&di=f6aec9bad624016a0786fc7eb1a12553&imgtype=0&src=http%3A%2F%2Fpic.51yuansu.com%2Fpic3%2Fcover%2F01%2F69%2F80%2F595f67bf2026f_610.jpg width="20px" height="20px"]] [http://Ins.com Insbilws] 2018年3月12日
> 回复@[http://Rish.com RishER] [http://库加尔.com 库加尔]：那些人似乎开始注意我们的行动了，因为我们碰见了一般人不可能也不应该去了解的东西，比如最近那台被拖走的车。他们并不希望我们了解到，并把它们和大家分享出去，不希望大众了解到他们不该了解的知识来着。

> [[image https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1545800610058&di=f6aec9bad624016a0786fc7eb1a12553&imgtype=0&src=http%3A%2F%2Fpic.51yuansu.com%2Fpic3%2Fcover%2F01%2F69%2F80%2F595f67bf2026f_610.jpg width="20px" height="20px"]] [http://拾荒者.com 拾荒者] 2018年3月12日
> 回复@[http://Ins.com Insbilws]：是这样吗？怪不得那时候追着库加尔追的那么狠，等等……越野车？老实人那台？

> [[image https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1545800610058&di=f6aec9bad624016a0786fc7eb1a12553&imgtype=0&src=http%3A%2F%2Fpic.51yuansu.com%2Fpic3%2Fcover%2F01%2F69%2F80%2F595f67bf2026f_610.jpg width="20px" height="20px"]] [http://Ins.com Insbilws] 2018年3月12日
> 回复@[http://拾荒者.com 拾荒者]：没错，那台车子会让人感觉不到时间过得很快吗，有个流浪汉就死在里面了。很可怜，结果车主想去要回来的时候已经被这个SCP基金会拿走了，我不知道他怎样了，回上海之后再也没他的消息了。

> [[image https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1545800610058&di=f6aec9bad624016a0786fc7eb1a12553&imgtype=0&src=http%3A%2F%2Fpic.51yuansu.com%2Fpic3%2Fcover%2F01%2F69%2F80%2F595f67bf2026f_610.jpg width="20px" height="20px"]] [http://Rish.com RishER] 2018年3月12日
> 回复@[http://拾荒者.com 拾荒者]：en……是个很让人在意的组织啊，不过你上次和我们说过了，不要去惹怒他们，那我们就和平一点吧。

> [[image https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1545800610058&di=f6aec9bad624016a0786fc7eb1a12553&imgtype=0&src=http%3A%2F%2Fpic.51yuansu.com%2Fpic3%2Fcover%2F01%2F69%2F80%2F595f67bf2026f_610.jpg width="20px" height="20px"]] [http://拾荒者.com 拾荒者] 2018年3月12日
> 回复@[http://Ins.com Insbilws]：这是当然，毕竟谁知道他们会开什么车或者用什么武器和我们开战，我们除了一个佐纪绪谁都不可能有战斗力啊……

> [[image https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1545800610058&di=f6aec9bad624016a0786fc7eb1a12553&imgtype=0&src=http%3A%2F%2Fpic.51yuansu.com%2Fpic3%2Fcover%2F01%2F69%2F80%2F595f67bf2026f_610.jpg width="20px" height="20px"]] [http://Ins.com Insbilws] 2018年3月12日
> 回复@[http://拾荒者.com 拾荒者]：要是有麻烦，我会想办法处理的，我也大概会让佐纪绪帮忙，总之先这样吧。

> [[image https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1545800610058&di=f6aec9bad624016a0786fc7eb1a12553&imgtype=0&src=http%3A%2F%2Fpic.51yuansu.com%2Fpic3%2Fcover%2F01%2F69%2F80%2F595f67bf2026f_610.jpg width="20px" height="20px"]] [http://拾荒者.com 拾荒者] 2018年3月12日
> 回复@[http://Ins.com Insbilws]：好的~~嘿！记得找我买东西啊，最近货流有点底下资金不够了啊。

